    <Nav>
      <Hamburger>
        <div>
          <Line></Line>
          <Line></Line>
          <Line></Line>
        </div>
        <TextMenu>Menu</TextMenu>
        <NavL>Menu</NavL>
      </Hamburger>
    </Nav>
  );
}

export default Siderbar;
